import React from 'react';
import {Iconuser} from './circle-user-solid.svg';

const login = () => {
    return (
        <div className="main bg-dark">
            <div className="sign-in-content">
                <img src={Iconuser} alt="icone utilisateur" />
                <h1>Sign In</h1>
            </div>
        </div>
    );
};

export default login;
